import React, { useState } from 'react';
import './cashflow.css'; // This file will contain the necessary CSS
import Footer from './footer';

const CashFlow = () => {
    const [income, setIncome] = useState({
        salaries: "",
        spouseIncome: "",
        businessIncome: "",
        investmentIncome: "",
        otherIncome: "",
    });

    const [expenditures, setExpenditures] = useState({
        food: "",
        rent: "",
        education: "",
        medical: "",
        clothing: "",
        hygiene: "",
        gas: "",
        transportation: "",
        water: "",
        electricity: "",
        internet: "",
        helperSalary: "",
        taxes: "",
        otherExpenses: "",
    });

    const [cashOutlays, setCashOutlays] = useState({
        debts: "", 
        productiveLoan: "",
        housingAmortization: "",
        vehicleAmortization: "",
        appliancesAmortization: "",
        insurance: "",
        otherCashOutlay: "",
    });

    const totalIncome = Object.values(income).reduce((acc, val) => acc + Number(val), 0);
    const totalExpenditures = Object.values(expenditures).reduce((acc, val) => acc + Number(val), 0);
    const totalCashOutlays = Object.values(cashOutlays).reduce((acc, val) => acc + Number(val), 0);
    
    // Calculate total expenditures and cash outlays
    const totalExpenditureAndCashOutlays = totalExpenditures + totalCashOutlays;
    const netSavings = totalIncome - totalExpenditureAndCashOutlays;

    // Handle form submission
    const handleSubmit = (event) => {
        event.preventDefault();
        alert("Youâ€™ve submitted your application.");
    };

    return (
        <div className="cashapplication">
            {/* Header Section */}
            <header className="header">
                <img src="logo.png" alt="MSU-IIT NMPC Logo" className="logol" />
                <h2 className="landingh2off2">MSU-IIT National Multi-Purpose Cooperative</h2>
            </header>

            {/* Form Container */}
            <div className="sulodPormcas">
                <h3 className="title">Cash Flow Statement</h3>
                <form className="cashflow" onSubmit={handleSubmit}>
                    {/* Income Section */}
                    <div className="section">
                        <h3>Income</h3>
                        {/* Income fields */}
                        {/* ... */}
                        <div className="item">
                            <label style={{ fontWeight: "bold" }}>TOTAL INCOME</label>
                            <input type="number" value={totalIncome} readOnly placeholder="â‚±" style={{ borderStyle: 'double', borderWidth: '3px',borderColor: '#000', }} />
                        </div>
                    </div>

                    {/* Expenditures Section */}
                    <div className="section">
                        <h3>Expenditures</h3>
                        {/* Expenditure fields */}
                        {/* ... */}
                        <div className="item">
                            <label style={{ fontWeight: "bold" }}>TOTAL EXPENDITURES</label>
                            <input type="number" value={totalExpenditures} readOnly placeholder="â‚±" style={{ borderStyle: 'double', borderWidth: '3px',borderColor: '#000', }} />
                        </div>
                    </div>

                    {/* Cash Outlays Section */}
                    <div className="section">
                        <h3>Cash Layout</h3>
                        {/* Cash outlay fields */}
                        {/* ... */}
                        <div className="item">
                            <label style={{ fontWeight: "bold" }}>TOTAL CASH OUTLAYS</label>
                            <input type="number" value={totalCashOutlays} readOnly placeholder="â‚±" style={{ borderStyle: 'double', borderWidth: '3px',borderColor: '#000', }} />
                        </div>
                        <div className="item">
                            <label style={{ fontWeight: "bold" }}>TOTAL EXPENDITURE AND CASH OUTLAYS</label>
                            <input type="number" value={totalExpenditureAndCashOutlays} readOnly placeholder="â‚±" style={{ borderStyle: 'double', borderWidth: '3px',borderColor: '#000', }} />
                        </div>
                        <div className="item">
                            <label style={{ fontWeight: "bold" }}>NET SAVINGS</label>
                            <input type="number" value={netSavings} readOnly placeholder="â‚±" style={{ borderStyle: 'double', borderWidth: '3px',borderColor: '#000', }} />
                        </div>
                    </div>

                    <br></br>
                    <p className="aboutp">
                        I certify to the correctness and truthfulness of the above statements according to my knowledge and belief. 
                        Any false declaration made by me which may be found later shall cause the disapproval of my loan application.
                    </p>
                    <br></br>

                    {/* Signatures and Submit */}
                    <div className="form-row-5">
                        {/* Signature fields */}
                        {/* ... */}
                    </div>

                    <button type="submit" class="submit-btn-1">Submit</button>
                </form>
                <br></br>
            </div>

            <Footer />
        </div>
    );
};

export default CashFlow;
